description:
Taxation revenue represents revenue received from the State’s taxpayers and includes: 
payroll tax; 
land tax; 
fire services property levy; 
duties levied principally on conveyances and land transfers; 
gambling taxes levied mainly on private lotteries, electronic gaming machines, casino operations and racing; 
insurance duty relating to compulsory third party, life and non-life policies; and insurance company contributions to fire brigades;
motor vehicle taxes, including registration fees and duty on registrations and transfers; and
other taxes include congestion levy, metropolitan improvement levy, growth areas infrastructure contribution, other property duties, financial accommodation levy, franchise taxes, landfill levies, licence fees, and progressive recognition of upfront concession fees paid by Transurban in respect of Melbourne CityLink and levies on statutory corporations in other sectors of government.
